        console.log(result.data.item)
        setData(result.data.item)
      }).catch((err)=>{
        console.log(err)
      })
      


}


useEffect(() => {
ok()
}, [user])


  return (
    <div>
      <Navbar />
      {data ? data.map(res =>{
        return (
            <div> {res.name} </div>
        )
      }) : null}
      <h1>Home</h1>
      {/* <a onClick={submit}>enter</a> */}
    </div>
  );
};

export default Home;
